import React from 'react';

const Home: React.FC = () => {
  return (
    <div className="text-center">
      <h1 className="text-5xl font-bold text-purple-500 mb-4">Royal Data Analyst</h1>
      <p className="text-lg text-gray-500 mb-4">
        Introverted GenZ with a passion for data analysis
      </p>
      <p className="mt-4">
        Welcome to my professional website! Explore my projects and feel free to reach out.
      </p>
    </div>
  );
};

export default Home;
